Bekasi, 18 September 2025

Pada hari ini, Kasi Pemtrantibum Kelurahan Jatirasa menghadiri rapat pembahasan rencana pembangunan sarana dan prasarana pengendalian banjir Polder di Jatirasa yang diselenggarakan di tempat Dinas Bina Marga dan Sumber Daya Air (DBMSDA) Kota Bekasi.

Rapat tersebut membahas rencana teknis pembangunan infrastruktur pengendalian banjir, meliputi sarana dan prasarana yang akan menunjang fungsi Polder di Jatirasa dalam meminimalisasi genangan maupun potensi banjir di wilayah sekitar.

Kelurahan Jatirasa turut memberikan masukan serta mendukung penuh langkah DBMSDA Kota Bekasi dalam upaya peningkatan fasilitas pengendalian banjir demi kenyamanan dan keselamatan warga

Kelurahan Jatirasa menyampaikan dukungan penuh serta menegaskan komitmen untuk berkoordinasi dengan seluruh pihak terkait, demi terwujudnya pengendalian banjir yang efektif dan berkelanjutan di wilayah Kelurahan Jatirasa dan sekitarnya

